import React from 'react';

class TasksManagement extends React.Component {

  render() {
    return (
      <div>
        <div className="row">
          <div className="col-6">
            add tasks
          </div>
          <div className="col-6">
            tasks list
          </div>
          </div>
      </div>
    );
  }
}

export default TasksManagement;
